  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Long Island NWR Complex for the next 15 years.
  This plan outlines the Complex vision and purpose and describes how Long Island
  NWR Complex will contribute to the overall mission of the Refuge System. The plan
  provides an introduction to the Complex, an overview of the CCP process, a summary
  of Refuge resources, and the management direction. Key planning issues include:
  threatened and endangered species, controlling invasive species, controlling mosquitoes,
  hunting, and partnerships.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
